public boolean equals(Object obj) {
  if (obj instanceof TermInfo) {
    TermInfo other = (TermInfo) obj;
    return other.docFreq == docFreq &&
      other.freqPointer == freqPointer &&
      other.proxPointer == proxPointer &&
      other.skipOffset == skipOffset;
  } else {
    return false;
  }
}

